import React from "react";

function App() {
  var count = 0;

  function increase() {
    count++;
    ReactDOM.render(
      <div className="container">
        <h1>{count}</h1>
        <button onclick={increase}>+</button>
    </div>,
    document.getElementById("root")
  );
}


  return <div />;
}

export default App;
